@import url('https://abbie.github.io/discord-css/import.css');

:root {
    --\\--hide-profile-effects: true;
    --\\--hide-avatar-decorations: true;
    --\\--hide-server-boost-goal: true;
    --\\--compact-server-list: true;
}

/* Nameplates hidden */
._4bbc6dc06e75ad52-container {
  display: none !important;
}

/* Hide help button */
a[href="https://support.discord.com/"] {
  display: none !important;
}

/* Hide "Notification Settings" */
._9293f6b2fc12398a-toolbar > ._9293f6b2fc12398a-iconWrapper[aria-label="Notification Settings"] {
    display: none;
}

/* Hide "Threads" */
._9293f6b2fc12398a-toolbar > ._9293f6b2fc12398a-iconWrapper[aria-label="Threads"] {
    display: none;
}

/* Clan tags */
._10651c5cfe637db6-chipletContainerInner > ._10651c5cfe637db6-text > ._10651c5cfe637db6-tagText {
  display: inline-block;
  white-space: nowrap;
  overflow: hidden;
  max-width: 0;
  will-change: max-width, margin;
  transition: max-width 0.5s cubic-bezier(0.34, 1.56, 0.64, 1),
              margin 0.5s cubic-bezier(0.34, 1.56, 0.64, 1);
}

._10651c5cfe637db6-chipletContainerInner:hover > ._10651c5cfe637db6-text > ._10651c5cfe637db6-tagText {
  max-width: 20ch;
  margin-right: .3ch;
  transition-delay: 0.08s;
}

._10651c5cfe637db6-chipletContainerInner > ._10651c5cfe637db6-text > img._10651c5cfe637db6-badge {
  margin-right: 0;
  transition: transform 0.5s cubic-bezier(0.34, 1.56, 0.64, 1),
              margin 0.5s cubic-bezier(0.34, 1.56, 0.64, 1);
}

._10651c5cfe637db6-chipletContainerInner:hover > span > img._10651c5cfe637db6-badge {
  transform: rotateZ(360deg);
  margin-right: .6ch;
  transition-delay: 0.08s;
}

._10651c5cfe637db6-chipletContainerInner {
  position: relative;
  display: inline-block;
  background-color: var(--background-mod-subtle);
  padding: 0 3px;
  margin-left: 3;
}

._10651c5cfe637db6-chipletContainerInner:hover ~ ._10651c5cfe637db6-tagText {
  display: block;
  clear: both;
  margin-top: .5ch;
}

